    false,nt"url": null,nt"notes": "This report summarizes the results of a
    study on monitoring public use at the Ugashik Narrows in order to discern the stability
    of the arctic grayling population. The goals of the 1988 study were to: record all
    visits by the public to the Narrows, the purpose of each visit, and document lodge
    use trends; and conduct a saturation creel survey by interviewing each person fishing
    at the termination of their visit. A description of the study area, methods used,
    and a discussion of the results is covered. Data forms are attached.",nt"owner_org":
